// src/pages/EventDetailsPage.js
import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import BookingModal from '../components/BookingModal';
import './EventDetailsPage.css';

const EventDetailsPage = () => {
  const { eventId } = useParams();
  const [event, setEvent] = useState(null);
  const [showModal, setShowModal] = useState(false);

  useEffect(() => {
    // Mock API call
    const mockEvent = {
      id: 1,
      title: "Avengers: Endgame",
      type: "movie",
      date: "2025-05-15",
      time: "7:30 PM",
      price: 300,
      genre: "Action",
      language: "English",
      location: "Mumbai",
      poster: "https://source.unsplash.com/random/1200x800?movie",
      theater: "PVR Cinemas, Phoenix Mall",
      details: {
        cast: ["Robert Downey Jr.", "Chris Evans", "Mark Ruffalo"],
        director: "Anthony and Joe Russo",
        duration: "3h 1m"
      }
    };
    setEvent(mockEvent);
  }, [eventId]);

  const renderEventDetails = () => {
    if (!event) return null;

    switch(event.type) {
      case 'movie':
        return (
          <div className="details-section">
            <h2>Movie Details</h2>
            <div className="detail-item">
              <span>Theater:</span>
              <p className="theater-name">{event.theater}</p>
            </div>
            <div className="detail-item">
              <span>Cast:</span>
              <div className="cast-list">
                {event.details.cast.map((actor, i) => (
                  <span key={i} className="cast-tag">{actor}</span>
                ))}
              </div>
            </div>
          </div>
        );

      case 'concert':
        return (
          <div className="details-section">
            <h2>Concert Details</h2>
            <div className="detail-item">
              <span>Artists:</span>
              <div className="artist-list">
                {event.details.artists.map((artist, i) => (
                  <span key={i} className="artist-tag">{artist}</span>
                ))}
              </div>
            </div>
          </div>
        );
    }
  };

  return (
    <div className="event-details-page">
      <div className="event-hero">
        <img src={event?.poster} alt={event?.title} className="event-poster" />
      </div>

      <div className="event-content">
        <h1 className="event-title">{event?.title}</h1>

        <div className="event-meta">
          <div className="meta-item">
            <span className="meta-label">Date & Time</span>
            <span className="meta-value">
              {new Date(event?.date).toLocaleDateString()} | {event?.time}
            </span>
          </div>
          <div className="meta-item">
            <span className="meta-label">Location</span>
            <span className="meta-value">{event?.location}</span>
          </div>
        </div>

        {renderEventDetails()}

        <div className="booking-cta">
          <div className="price-container">
            <span className="price-label">Starting from</span>
            <span className="price">₹{event?.price}</span>
          </div>
          <button 
            className="book-button"
            onClick={() => setShowModal(true)}
          >
            Book Now
          </button>
        </div>
      </div>

      {showModal && <BookingModal event={event} onClose={() => setShowModal(false)} />}
    </div>
  );
};

export default EventDetailsPage;
